import MovieList from './comp/MovieList'
import './style-main.css'
import './style-global.css'

import { useState } from 'react'

function App() {

  return (
    <div className="main">
      <div className="movies">
        <div className="container">
          <div className="movies-inner">
            <MovieList />
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
